INSERT INTO `agriculture_master` (`agriculture_id`, `agriculture_uuid`, `agriculture_type_id`, `agriculture_category_id`, `agriculture_title`, `agriculture_slug`, `agriculture_image`, `agriculture_icon`, `agriculture_cultivate_min_duration`, `agriculture_cultivate_max_duration`, `agriculture_excerpt`, `agriculture_description`, `agriculture_created_at`, `agriculture_updated_at`, `deleted_at`, `agriculture_created_by`, `agriculture_updated_by`, `agriculture_status`) VALUES
(1, NULL, 1, 1, 'Carrot', 'carrot', 'RmkyLmtgE1UcUGDGpGBc9i308Q5mV6A2nS84pHs7.svg', 'unZLn5pmR1QuiaAXCXFVNyOZpDgQhFboWscOa5Tq.svg', 3, 5, 'The carrot (Daucus carota subsp. sativus) is a root vegetable, usually orange in colour, though purple, black, red, white, and yellow cultivars exist.', 'The carrot (Daucus carota subsp. sativus) is a root vegetable, usually orange in colour, though purple, black, red, white, and yellow cultivars exist.Carrots are a domesticated form of the wild carrot, Daucus carota, native to Europe and southwestern Asia. The plant probably originated in Persia and was originally cultivated for its leaves and seeds. The most commonly eaten part of the plant is the taproot, although the stems and leaves are eaten as well. The domestic carrot has been selectively bred for its greatly enlarged, more palatable, less woody-textured taproot.', '2019-07-16 11:04:00', '2019-07-16 11:04:00', NULL, 1, 1, 1),
(2, NULL, 2, 1, 'Aubergines', 'aubergines', 'eFqd7eoGwpV0KA1hmqpjdiMmZX0wpEaJA4jwWXvF.svg', '22NGpcSQRaCRzWtQR5qYFCXNNUgWmmkpi4srJy3K.svg', 2, 3, 'Aubergines is a plant species in the nightshade family Solanaceae. Solanum melongena is grown worldwide for its edible fruit.', 'Aubergines is a plant species in the nightshade family Solanaceae. Solanum melongena is grown worldwide for its edible fruit.Most commonly purple, the spongy, absorbent fruit is used in various cuisines. Although often considered a vegetable, it is a berry by botanical definition. As a member of the genus Solanum, it is related to tomato and potato. Like the tomato, its skin and seeds can be eaten, but, like the potato, it is usually eaten cooked. Eggplant is nutritionally low in macronutrient and micronutrient content, but the capability of the fruit to absorb oils and flavors into its flesh through cooking expands its use in the culinary arts.', '2019-07-16 11:05:24', '2019-07-16 11:21:41', NULL, 1, 1, 1),
(3, NULL, 1, 1, 'Beans', 'beans', 'gfEQfaI9oknbWNedX7X78sv9CSZYntY3Dntic35d.svg', 'TcW1furxVOGyuysrQakIlgfDodESHSic2xVrIbto.svg', 1, 2, 'Beans are among the most nutritious and healthiest foods you can eat.', 'Beans are among the most nutritious and healthiest foods you can eat.', '2019-07-16 11:06:21', '2019-07-16 11:06:21', NULL, 1, 1, 1),
(4, NULL, 1, 1, 'Beetroot', 'beetroot', 'gwvGebVUgs2xWkvpnM0EC96D2HCRvE7BpiDSeH0B.svg', 'fDQve9WFVexMTOKYXfkIypTJpWNHvvo4XWTcberw.svg', 2, 3, 'Beetroot, also known as beet, has been gaining in popularity as a new super food due to recent studies claiming that beets and beetroot juice can improve athletic performance, lower blood pressure, and increase blood flow.', 'Beetroot, also known as beet, has been gaining in popularity as a new super food due to recent studies claiming that beets and beetroot juice can improve athletic performance, lower blood pressure, and increase blood flow.', '2019-07-16 11:07:10', '2019-07-16 11:07:10', NULL, 1, 1, 1),
(5, NULL, 1, 1, 'Broccoli', 'broccoli', 'JgEVzTkATyBPFsHAPJbQ3hDv3ZmiE1QYIfEPlmr7.svg', 'ZR4rJz5vIj3ry0JGwi7GV5RwY0Ci7pGwqjyHtngW.svg', 2, 3, 'Broccoli belongs to the cruciferous vegetable family, which includes kale, cauliflower, Brussels sprouts, bok choy, cabbage, collard greens, rutabaga, and turnips. These nutrition powerhouses supply loads of nutrients for few calories.', 'Broccoli belongs to the cruciferous vegetable family, which includes kale, cauliflower, Brussels sprouts, bok choy, cabbage, collard greens, rutabaga, and turnips. These nutrition powerhouses supply loads of nutrients for few calories.', '2019-07-16 11:08:16', '2019-07-16 11:08:16', NULL, 1, 1, 1),
(6, NULL, 1, 1, 'Cabbage', 'cabbage', 'N7ioahz9Gj5DNRPYySYCV73AdOeWfbxoE9jvxN6w.svg', 'NwuyqoajF2YK6d5tvymXopxbQlesN0fOxAL7uHmF.svg', 1, 3, 'Cabbage or headed cabbage (comprising several cultivars of Brassica oleracea) is a leafy green, red (purple), or white (pale green) biennial plant grown as an annual vegetable crop for its dense-leaved heads.', 'Cabbage or headed cabbage (comprising several cultivars of Brassica oleracea) is a leafy green, red (purple), or white (pale green) biennial plant grown as an annual vegetable crop for its dense-leaved heads.', '2019-07-16 11:09:12', '2019-07-16 11:09:12', NULL, 1, 1, 1),
(7, NULL, 1, 1, 'Corn', 'corn', 'HEo5he2XENpCq08cZxfWuDNrnXrXczaqsIhzwL2h.svg', '746eC1rjJCG66eZQLy2X5vuMWZTA4Tx7siLrqp62.svg', 1, 3, 'Cornhas become a staple food in many parts of the world, with the total production of maize surpassing that of wheat or rice. However, little of this maize is consumed directly by humans: most is used for corn ethanol, animal feed and other maize products, such as corn starch and corn syrup.', 'Cornhas become a staple food in many parts of the world, with the total production of maize surpassing that of wheat or rice. However, little of this maize is consumed directly by humans: most is used for corn ethanol, animal feed and other maize products, such as corn starch and corn syrup.', '2019-07-16 11:10:08', '2019-07-16 11:10:08', NULL, 1, 1, 1),
(8, NULL, 1, 1, 'Onion', 'onion', 'ORbxC95fSN6pXKyHbiQQiKbaf5rbk5QxomXnYVCt.svg', 'X2avLTGgzKinkd0bqGowAbBiuwZ3wRnsFedO5C4A.svg', 1, 2, 'The onion plant has a fan of hollow, bluish-green leaves and its bulb at the base of the plant begins to swell when a certain day-length is reached. The bulbs are composed of shortened, compressed, underground stems surrounded by fleshy modified scale (leaves) that envelop a central bud at the tip of the stem.', 'The onion plant has a fan of hollow, bluish-green leaves and its bulb at the base of the plant begins to swell when a certain day-length is reached. The bulbs are composed of shortened, compressed, underground stems surrounded by fleshy modified scale (leaves) that envelop a central bud at the tip of the stem.', '2019-07-16 11:11:04', '2019-07-16 11:11:04', NULL, 1, 1, 1),
(9, NULL, 1, 1, 'Potato', 'potato', 'EnkNUc3WpOoB7JjdwYGX9OYCdQzAlFv6tErdC8g6.svg', 'WpQsPkhi0jplE0YGvhFQWsoWFmW6JsXkf4aJucoS.svg', 2, 4, 'The potato is a starchy, tuberous crop from the perennial nightshade Solanum tuberosum, native to the Americas.', 'The potato is a starchy, tuberous crop from the perennial nightshade Solanum tuberosum, native to the Americas.', '2019-07-16 11:12:02', '2019-07-16 11:12:02', NULL, 1, 1, 1),
(10, NULL, 1, 1, 'Pumpkin', 'pumpkin', 'bM2kGhngjGvfRFNGG73A9YmzTknEZAZ1G1chcEQ9.svg', 'nqI1oK1G2Vx0GcjgQ5ZiopVBAdBKx9K6hoY6gKKk.svg', 1, 2, 'A pumpkin is a cultivar of a squash plant, most commonly of Cucurbita pepo, that is round with smooth, slightly ribbed skin, and most often deep yellow to orange in coloration.[1] The thick shell contains the seeds and pulp.', 'A pumpkin is a cultivar of a squash plant, most commonly of Cucurbita pepo, that is round with smooth, slightly ribbed skin, and most often deep yellow to orange in coloration.[1] The thick shell contains the seeds and pulp.', '2019-07-16 11:12:57', '2019-07-16 11:12:57', NULL, 1, 1, 1),
(11, NULL, 1, 1, 'Tomato', 'tomato', 'njDPOvfAC8YgqvfiTOqUMwRseez090UKS6u046dx.svg', 'YyUEDxyEzJb5StMIgIGUu1L1IYoU556loFNrpLAY.svg', 3, 5, 'The tomato is the edible, often red, berry of the plant Solanum lycopersicum,commonly known as a tomato plant. The species originated in western South America and Central America.The Nahuatl (Aztec language) word tomatl gave rise to the Spanish word tomate, from which the English word tomato derived.Its domestication and use as a cultivated food may have originated with the indigenous peoples of Mexico.', 'The tomato is the edible, often red, berry of the plant Solanum lycopersicum,commonly known as a tomato plant. The species originated in western South America and Central America.The Nahuatl (Aztec language) word tomatl gave rise to the Spanish word tomate, from which the English word tomato derived.Its domestication and use as a cultivated food may have originated with the indigenous peoples of Mexico.', '2019-07-16 11:13:50', '2019-07-16 11:13:50', NULL, 1, 1, 1),
(12, NULL, 1, 1, 'Grape', 'grape', '6b1QzJDJJgESqT9C59pPTti6GNZbphkQIlc9ttfJ.png', 'dotCAc1cVYeaM13HQVejq94lUKzf8qNarifVBGWI.png', 3, 4, 'A grape is a fruit, botanically a berry, of the deciduous woody vines of the flowering plant genus Vitis. Grapes can be eaten fresh as table grapes or they can be used for making wine, jam, juice, jelly, grape seed extract, raisins, vinegar, and grape seed oil.', 'A grape is a fruit, botanically a berry, of the deciduous woody vines of the flowering plant genus Vitis. Grapes can be eaten fresh as table grapes or they can be used for making wine, jam, juice, jelly, grape seed extract, raisins, vinegar, and grape seed oil.', '2019-07-16 11:42:39', '2019-07-16 11:42:39', NULL, 1, 1, 2);
