(1, 'Farmer', 'farmer', 'bMzDz3GkttJpXintsUaTg91liNBipVOJ7nzQVTdk.jpeg', '8Ylpd4yaiAfjKfSBxrS86rewrVl63FwjXFwuServ.png', 'A farmer (also called an agriculturer) is a person engaged in agriculture, raising living organisms for food or raw materials.', 'A farmer (also called an agriculturer) is a person engaged in agriculture, raising living organisms for food or raw materials. The term usually applies to people who do some combination of raising field crops, orchards, vineyards, poultry, or other livestock.', '2019-07-16 10:38:31', '2019-07-17 10:32:08', NULL, 1, 1, 1),
(2, 'Irrigation', 'irrigation', 'XuXQwYHONvLpsUMEUcldgqlvJ85RDc2GuZtZvjQB.jpeg', '0AJxEkU4wlY3F840HRfMVvOw4W0G6k5iRZaBbMl6.png', 'Irrigation is the application of controlled amounts of water to plants at needed intervals.', 'Irrigation is the application of controlled amounts of water to plants at needed intervals. Irrigation helps to grow agricultural crops, maintain landscapes, and revegetate disturbed soils in dry areas and during periods of less than average rainfall.', '2019-07-16 10:40:44', '2019-07-17 10:34:01', NULL, 1, 1, 1),
(3, 'Electricity', 'electricity', 'M1j0lv4wJuMxCvjB5fUHGGse8JAKVmW31lUuUcXh.jpeg', 'Z14RpuoVENaInXS4Q3U8yi7rVUbwZGGYVV5eFuXn.png', 'Electricity is the set of physical phenomena associated with the presence and motion of matter that has a property of electric charge.', 'Electricity is the set of physical phenomena associated with the presence and motion of matter that has a property of electric charge.', '2019-07-16 10:42:48', '2019-07-17 10:31:59', NULL, 1, 1, 1),
(4, 'Machinery', 'machinery', 'alPegWYH7dl7SXEY9EVnnD79GvddwMjQxj3p8HFL.jpeg', 'X2UnNBM9PHmKngYstuYlgZZPIHOmF1j9FDJpH35Q.png', 'A machine is a mechanical structure that uses power to apply forces.', 'A machine (or mechanical device) is a mechanical structure that uses power to apply forces ... building air handling and water handling systems, as well as farm machinery, machine tools and factory automation systems and robots.', '2019-07-16 10:44:45', '2019-07-17 10:35:35', NULL, 1, 1, 1),
(5, 'Storage', 'storage', 'eCVJsnvTWvNVL77P1PX6KlObfjVTQZOtYoiZtFvT.jpeg', 'oIk8N5Ysao627PLdugyk7PRJpVeh7Q9TrvNzC8TC.jpeg', 'Storage means the phase of the post-harvest system during which the products are kept in such a way as to guarantee food security other than during periods of agricultural production.', 'Agricultural engineering in development - Storage. Storage. Contents - Previous - Next. Definition. Storage means the phase of the post-harvest system during which the products are kept in such a way as to guarantee food security other than during periods of agricultural production.', '2019-07-16 10:52:28', '2019-07-17 10:36:25', NULL, 1, 1, 1),
