(7, 10006, 'c2401245-28af-50f9-b2df-1a7900584db4', 'Golden Hill Farm', 'golden-hill-farm', 6980, '32', 'Pruvrmat2sg5xeKsqrjyO7ZTpQivQjjSfITfGdgL.jpeg', NULL, 184, 'Riyadh Province', 'Riyadh', '69644', '19.94104883258959', '44.1606316025734', 1, '54.00', 'Acre', 6, 'k9bu3LBkkDDHcvasKCM1sFKZL4oWSz8ytvMfYrpg.jpeg', 2, 1, 2, 'ul7V6LUevKLoFgUNxDQkb5hqqPiG3dasFaGqt4LF.pdf', NULL, NULL, 'Golden hill', 'Golden Hills Farm is a 100 acre private facility owned by Steve and Amanda Ray of El Ray Performance Horses, Inc. The facility embraces the beautiful rolling hills and Oak trees that represent the Paso Robles landscape.', 'Golden Hills Farm is a 100 acre private facility owned by Steve and Amanda Ray of El Ray Performance Horses, Inc. The facility embraces the beautiful rolling hills and Oak trees that represent the Paso Robles landscape.', NULL, '2019-07-24', '2019-10-30', '2019-07-16 13:04:12', '2019-08-14 13:53:05', 6980, 6980, 1, 0),
(8, 10007, 'a8d17378-abee-5a1a-ac57-ed473c998857', 'Birch Wood Farm', 'birch-wood-farm', 6980, '46', '7MO9j26h7VcpqUnfpTcA46nC6cNFdPfZD4qVVQOg.jpeg', NULL, 99, 'Kerala', 'Ernakulam', '682506', '9.904154438218727', '76.31542551414805', 1, '6.00', 'Acre', 10, 'iS1aunzcVsSVG92g3CIikFZwKraQmIbghC122bYn.jpeg', 2, 5, 2, 'lXiO7FI8HsNNq5PlIpPn40YELvxDm2gBekAq6RAv.pdf', NULL, NULL, 'Birch Wood Farm', 'It\'s likely your farm or ranch will have some livestock. If the name for your farm doesn\'t need to represent what you raise or grow, consider using the name of an animal that is native to the region. It could be one that you currently see or even one that was there in the past.', 'It\'s likely your farm or ranch will have some livestock. If the name for your farm doesn\'t need to represent what you raise or grow, consider using the name of an animal that is native to the region. It could be one that you currently see or even one that was there in the past.', 'It\'s likely your farm or ranch will have some livestock. If the name for your farm doesn\'t need to represent what you raise or grow, consider using the name of an animal that is native to the region. It could be one that you currently see or even one that was there in the past.', '2019-07-16', '2019-12-31', '2019-07-17 05:34:49', '2019-09-03 10:27:23', 6980, 6980, 1, 0),
(9, 10008, '1d45686f-af98-5cde-b912-b1f6f7930c19', 'Magnolia Ranch', 'magnolia-ranch', 6980, '31', 'u0OyzL6VP5nGX57adczmeLJQF79QJd3ky7tlyYS5.jpeg', NULL, 221, 'Abu Dhabi', 'Eastern Region', NULL, '24.61917835700495', '55.19389570312501', 1, '45.00', 'Acre', 5, 'ZOs12nA1KFiEJeaPUddqjth2HNncXTTaWGKf1SRW.jpeg', 2, 4, 3, NULL, NULL, NULL, 'Magnolia Ranch', 'I personally love to see a bit of levity when it comes to farming. If you have a small farm or homestead you will know a sense of humor is crucial. Tell me I am not the only one who has chased chickens or guinea fowl around a coop trying to get them to go in.', 'I personally love to see a bit of levity when it comes to farming. If you have a small farm or homestead you will know a sense of humor is crucial. Tell me I am not the only one who has chased chickens or guinea fowl around a coop trying to get them to go in.', NULL, '2019-07-17', '2019-12-31', '2019-07-17 05:39:36', '2019-08-14 13:54:13', 6980, 6980, 1, 0),
(10, 10009, 'f37ff3a0-e7ef-53c6-8d7d-bcc219455ebc', 'Lake View Farm', 'lake-view-farm', 6979, '53', 'euiS7eYM6dfBDUp32ZG6VEEisUY6ZEo5FP2hJYzJ.jpeg', NULL, 221, 'Dubai', 'Dubai', NULL, '25.199165961518514', '55.25904119567872', 1, '34.00', 'Acre', 13, 'Fae4hDizRMd7EgHpaVddUsgHKhR8DMgM1g2rdkXa.jpeg', 3, 4, 2, 'XeeU64uhiMV9DE3bbyMMajsWLa20gh5LkNEnkJTu.png', NULL, NULL, 'Lake', 'Farm Background: This Farm is a 25 acre farm nestled in the beautiful and peaceful Valley.  The focus on this farm is the growing of healthy and flavorful foods while using earth friendly sustainable practices.  In effort to continually reduce a carbon footprint on earth, the farm has a solar system, state-of-the-art water reclamation system, and several compost piles which all assist the organic methods of producing nutritionally rich foods.  We are continuing all those same practices as we grow the business!', 'Farm Background: This Farm is a 25 acre farm nestled in the beautiful and peaceful Valley.  The focus on this farm is the growing of healthy and flavorful foods while using earth friendly sustainable practices.  In effort to continually reduce a carbon footprint on earth, the farm has a solar system, state-of-the-art water reclamation system, and several compost piles which all assist the organic methods of producing nutritionally rich foods.  We are continuing all those same practices as we grow the business!', NULL, '2019-07-23', '2019-10-31', '2019-07-17 06:23:01', '2019-08-15 05:13:40', 6979, 6979, 1, 0),
