(17, 10016, '6a961b81-1e37-5aea-a255-11855e19eeab', 'Willow Way', 'willow-way', 6979, '34', 'WCychQKIVaFNHH9r22nFFmhLkToxNrkyVKVpalPN.jpeg', NULL, 99, 'Kerala', 'Malappuram', '679334', '11.403271996285419', '76.2407097275734', 1, '13.00', 'Acre', 12, '3NiTa11wD5NqGRkE9Np2VAJyONiHfqzi7nM8vqQL.png', 2, 2, 2, NULL, NULL, NULL, 'willow', 'Let everyone throw their ideas into an old milk jug, feed sack, or another farm-related receptacle. The reason for gathering everyone together is it encourages others to contribute. It will also give you better results. If you understand how a mastermind group works, this is the same thing. Ideas and names will come out you hadn\'t thought of before. Having everyone together for a \'farm naming party\' you will reap more possible names than you can think of by yourself. Make sure to provide everyone with enough writing material. If they are local, they may know the history of your area and think up a name related to that. Also ask for names in another language that could be used as part of the name. Spanish, French, and Indian names may be suitable if applicable to the area you live in.', 'Let everyone throw their ideas into an old milk jug, feed sack, or another farm-related receptacle. The reason for gathering everyone together is it encourages others to contribute. It will also give you better results. If you understand how a mastermind group works, this is the same thing. Ideas and names will come out you hadn\'t thought of before. Having everyone together for a \'farm naming party\' you will reap more possible names than you can think of by yourself. Make sure to provide everyone with enough writing material. If they are local, they may know the history of your area and think up a name related to that. Also ask for names in another language that could be used as part of the name. Spanish, French, and Indian names may be suitable if applicable to the area you live in.', NULL, '2019-07-24', '2019-11-30', '2019-07-23 05:33:31', '2019