INSERT INTO `meta` (`id`, `metable_type`, `metable_id`, `type`, `key`, `value`) VALUES
(26, 'App\\Models\\Admodels\\PostModel', 1, 'string', 'large_description', '<p>The UAE government is keen to activate the role of the community and involve individuals in the development and proposal of government policies for decision making in the country. Policy development is a key element for planning the future and strategic orientations of the UAE, and government policies contribute to the UAE government\'s vision and strategy and provide better government services in line with the needs of individuals and developments.</p><p>The \"Government Policy Lab platform\" aims to create an interactive and engaged community that has a role to play in the development and design of government policies and decisions to attract the ideas and proposals from members of the society, since the Government does not have experience in some topics and sectors that may have never been regulated before. The participatory platform will therefore aim to engage interested and experienced members of the community to co-design government policy profiles that may contribute to launching initiatives and projects designed by the community for the community. In addition to identifying the challenges and areas of development in all sectors, and exploring possible changes that may make policies more successful in raising level of happiness in the country.</p>'),
(27, 'App\\Models\\Admodels\\PostModel', 1, 'string', 'large_description_arabic', '<p>تحرص حكومة الامارات على تفعيل دور المجتمع وإشراك الأفراد في وضع واقتراح سياسات الحكومية لصنع القرارات في الدولة . يعتبر وضع السياسات عنصر أساسي للتخطيط للمستقبل وللتوجهات الاستراتيجية لدولة الامارات، وتساهم السياسات الحكومية في تحقيق رؤية واستراتيجية حكومة الامارات وتأمين خدمات حكومية أفضل وبما يتفق مع احتياجات الأفراد والتطورات الحاصلة.</p><p>تهدف \"منصة مختبر السياسات الحكومية\" إلى تكوين مجتمع متفاعل له دور في وضع وتصميم السياسات والقرارات الحكومية واستقطاب أفكار ومقترحات أفراد المجتمع نظرا إلى أن الحكومة لا تمتلك الخبرة والتجربة في بعض المواضيع والقطاعات التي لم يسبق تنظيمها. ولذلك ستهدف المنصة التشاركية إلى الاستعانة بالمهتمين وأصحاب الخبرة من أفراد المجتمع لتصميم ملامح السياسة الحكومية والتي قد تساهم في اطلاق مبادرات ومشاريع من وإلى المجتمع .بالإضافة إلى تحديد التحديات ومجالات التطوير في جميع القطاعات، والتفكير في التغييرات المحتملة التي قد تجعل السياسات أكثر نجاحاً في الارتقاء بمستويات السعادة وتحسين جودة الحياة في الدولة.</p>'),
