(30, 'App\\Models\\Admodels\\PostModel', 2, 'string', 'video_url', 'https://www.youtube.com/watch?v=qauN9lESiEU'),
(54, 'App\\Models\\Admodels\\PostModel', 4, 'string', 'content', 'Although the place is designed to help youth exploring it by themselves (think of it as an open museum).<br /><br />The Youth Hub team is happy to give you a 20 minutes descriptive tour from Sunday to Thursday at 11:00 AM'),
(55, 'App\\Models\\Admodels\\PostModel', 4, 'string', 'content_arabic', 'صحيح أن المكان مصمم ليساعد الشباب لاكتشاف المكان بأنفسهم (فكر بتجربتك في المتاحف).<br /><br />بالرغم من ذلك، يسعد فريق مركز الشباب أن يعطيكم جولة مفصلة لمدة 20 دقيقة من الأحد إلى الخميس في الساعة 11:00 صباحاً.'),
(60, 'App\\Models\\Admodels\\PostModel', 5, 'string', 'content', '<p>The Youth x Hub is a home for Youth to connect them to people, power and potential. &nbsp;<strong>#DoneByYouth</strong> &nbsp;</p>'),
(61, 'App\\Models\\Admodels\\PostModel', 5, 'string', 'content_arabic', '<p>بُني هذا المركز بمجهود الشباب، وبمشاركة الشباب، وبإدارة الشباب ليحتضن إبداعات الشباب ويتيح لهم التشارك والتفاعل واستغلال كامل إمكانياتهم ضمن بيئة إبداعية تهدف إلى بناء مجتمعات شبابية رائدة.</p>'),
(62, 'App\\Models\\Admodels\\PostModel', 5, 'string', 'video_url', 'https://www.youtube.com/watch?v=1q1aEls0M18'),
(63, 'App\\Models\\Admodels\\PostModel', 5, 'string', 'main_image', '3b546e56798e1da56fda701572293f42.jpeg'),
(64, 'App\\Models\\Admodels\\PostModel', 5, 'string', 'menu_icon', 'hubicons-hub-the-hub'),
(74, 'App\\Models\\Admodels\\PostModel', 6, 'string', 'content', '<p><strong>So HOW did we find the people and connect their ideas?</strong></p><p>The chief belief of the the UAE leadership and Ministry of Youth is that Young people can design solutions to our greatest challenges. The first challenge was creating a central forum for Youth to connect and share their ideas.</p>'),
(75, 'App\\Models\\Admodels\\PostModel', 6, 'string', 'content_arabic', '<p><strong>لماذا بٌني المركز؟</strong></p><p>لا توجد مساحات عمل وتفاعل مشتركة للشباب، معظم لقاءات الشباب تكون في المقاهي، أو الجامعات، أو النوادي الرياضية. المراكز الشبابية في المنطقة معظمها مقتصرة على الأنشطة الرياضية أو الفنية وتركز على قطاع معيّن. الشباب بحاجة لمركز يحتضن إبداعاتهم المشتركة. هناك نماذج عدة وقصص نجاح لمساحات مشتركة لروّاد الأعمال والعلماء حول العالم، نستطيع صناعة قصة نجاح والاستفادة من التجارب العالمية</p><p><br /><br /></p>'),
