(77, 'App\\Models\\Admodels\\PostModel', 6, 'string', 'menu_icon', 'hubicons-hub-the-start'),
(86, 'App\\Models\\Admodels\\PostModel', 8, 'string', 'short_description', 'Then the newspapers pitched in and sent out invitations for Youth to contribute their ideas for how the UAE must move forward. In the first two weeks, we heard from over 2,000 Youth across all 7 Emirates.'),
(87, 'App\\Models\\Admodels\\PostModel', 8, 'string', 'short_description_arabic', '<span>شارك شباب الإمارات بأفكارهم حول مكونات المركز عبر وسم #مركز_الشباب</span>'),
(88, 'App\\Models\\Admodels\\PostModel', 8, 'string', 'large_description', '<p>Then the newspapers pitched in and sent out invitations for Youth to contribute their ideas for how the UAE must move forward. In the first two weeks, we heard from over 2,000 Youth across all 7 Emirates.</p><p>Newspapers were so impressed with Youth response that they posted replies to their ads and prompted interviews with Youth to further explore their ideas and insights on participating in the UAE&rsquo;s &ldquo;Powered By Youth&rdquo; model.</p>'),
(89, 'App\\Models\\Admodels\\PostModel', 8, 'string', 'large_description_arabic', '<p>Then the newspapers pitched in and sent out invitations for Youth to contribute their ideas for how the UAE must move forward. In the first two weeks, we heard from over 2,000 Youth across all 7 Emirates.</p><p>Newspapers were so impressed with Youth response that they posted replies to their ads and prompted interviews with Youth to further explore their ideas and insights on participating in the UAE&rsquo;s &ldquo;Powered By Youth&rdquo; model.</p>'),
(90, 'App\\Models\\Admodels\\PostModel', 9, 'string', 'short_description', 'Finally, we set up Youth Circles, our signature platform that creates a two-way dialogue between Youth and government. A Youth Circle is simple, really; it involves us listening. Listening skillfully to Youth. Then we come up with transparent outcomes from the discussions.'),
(91, 'App\\Models\\Admodels\\PostModel', 9, 'string', 'short_description_arabic', '<span>عمل فريق من الشباب على الإشراف على المركز وتطويره ليشمل مقترحات الشباب وبناءه خلال 6 أشهر</span>'),
