(93, 'App\\Models\\Admodels\\PostModel', 9, 'null', 'large_description_arabic', ''),
(94, 'App\\Models\\Admodels\\PostModel', 10, 'string', 'short_description', 'Out of these discussions with Youth came the idea for the Youth xHub, our first major initiative.&nbsp;'),
(95, 'App\\Models\\Admodels\\PostModel', 10, 'string', 'short_description_arabic', '<span>شارك الشباب في التصميم الداخلي، وتطوير المساحات المختلفة، وإضافة اللمسات الإبداعية على المركز</span>'),
(96, 'App\\Models\\Admodels\\PostModel', 10, 'string', 'large_description', '<p>Out of these discussions with Youth came the idea for the Youth xHub, our first major initiative.&nbsp;</p><p>It&rsquo;s easy to collect ideas; however, it&rsquo;s more of an art to translate ideas into meaningful outcomes. Our process was simple and focused.&nbsp;</p>'),
(97, 'App\\Models\\Admodels\\PostModel', 10, 'string', 'large_description_arabic', '<p>Out of these discussions with Youth came the idea for the Youth xHub, our first major initiative.&nbsp;</p><p>It&rsquo;s easy to collect ideas; however, it&rsquo;s more of an art to translate ideas into meaningful outcomes. Our process was simple and focused.&nbsp;</p>'),
(98, 'App\\Models\\Admodels\\PostModel', 11, 'string', 'short_description', 'We collected every message Youth sent us from calls, emails, social media, newspapers and Youth Circles.'),
(99, 'App\\Models\\Admodels\\PostModel', 11, 'string', 'short_description_arabic', '<span>شارك الشباب في البحث عن الشراكات، وتطوير البرامج والفعاليات والأنشطة لتفعيل مساحات المركز</span>'),
(100, 'App\\Models\\Admodels\\PostModel', 11, 'string', 'large_description', 'We collected every message Youth sent us from calls, emails, social media, newspapers and Youth Circles.&nbsp;<br /><br />Then, we divided them into categories and tracked similarities. Immediately, a glaring trend stood out: Everyone wanted a coworking space. And everyone wanted continuous learning beyond the university. This was a powerful revelation: Youth want to learn year round AND they want to do it together!'),
(101, 'App\\Models\\Admodels\\PostModel', 11, 'string', 'large_description_arabic', '<p>We collected every message Youth sent us from calls, emails, social media, newspapers and Youth Circles.&nbsp;</p><p>Then, we divided them into categories and tracked similarities. Immediately, a glaring trend stood out: Everyone wanted a coworking space. And everyone wanted continuous learning beyond the university. This was a powerful revelation: Youth want to learn year round AND they want to do it together!</p>'),
