(206, 'App\\Models\\Admodels\\PostModel', 28, 'string', 'short_description', '<p>In an ever-changing and fast-paced world, the Youth x Hub welcomes Youth from all walks of life, aged between 15 and 35 - whether students, employees or entrepreneurs. The Hub will be the platform to connect Youth to each other, bounce thoughts back and forth, and launch-spring their ideas.&nbsp;</p>'),
(207, 'App\\Models\\Admodels\\PostModel', 28, 'string', 'short_description_arabic', '<p>يستقبل المركز الشباب من الفئة العمرية 15 إلى 35، سواء كانوا طلبة، أو موظفين، أو روّاد أعمال، ومن مختلف القطاعات. سيكون المركز منصة لالتقاء الشباب وتبادل الخبرات واحتضان الأفكار والإبداعات.</p>'),
(208, 'App\\Models\\Admodels\\PostModel', 28, 'string', 'large_description', '<p>While our world is changing exponentially with new technologies and scientific advances, we believe society&rsquo;s response to them is stunted by embracing the myth that Youth are a problem and lack the capacity to lead effectively. It poses a great threat to our security and prosperity.</p><p>If we simply flip our lens to view Youth as a premier asset class or as energy to harness, IMAGINE how much more we, as a global community, would be adept in solving the greatest social and systemic challenges of our time.</p><p>60% of the population in the Middle East and North Africa region are between ages 15-35. They are educated, energetic, and diverse. They are hungry for jobs, for community and for opportunity to actualize their purpose as human beings.</p><p>Part of this purpose must be attained through meaningful employment. The other, through connection. To others in activities of significance - and to themselves.</p><p>With the fast-changing global economy and our systems on the brink of major development and disruption, we don&rsquo;t have the time to wait for young leaders to turn 40! We must empower and engage them now.</p><p>Youth have the raw materials, fresh ideas, and moldable talents to usher in the innovations and creative solutions to the challenges that they and our societies face every day - and those future generations will also face.</p>'),
(209, 'App\\Models\\Admodels\\PostModel', 28, 'string', 'large_description_arabic', '<p><strong><span style=\"font-weight: 400;\">يستقبل المركز الشباب من الفئة العمرية 15 إلى 30، سواء كانوا طلبة، أو موظفين، أو روّاد أعمال، ومن مختلف القطاعات. سيكون المركز منصة لالتقاء الشباب وتبادل الخبرات واحتضان الأفكار والإبداعات.</span></strong></p>'),
(210, 'App\\Models\\Admodels\\PostModel', 28, 'string', 'main_image', '87e723b5b5e5e46f18af3b0e8fe6b8e2.jpg'),
(211, 'App\\Models\\Admodels\\PostModel', 7, 'string', 'short_description', 'We made an intentional and assertive push to reach Emirati Youth across all 7 Emirates and around the world.'),
(212, 'App\\Models\\Admodels\\PostModel', 7, 'string', 'short_description_arabic', 'اطلعنا على أفضل الممارسات العالمية، وعلى ما توفره المراكز، والمساحات المشتركة، والمسرعّات، والحاضنات حول العالم ونفخر بأن مركز الشباب هو الأفضل.'),
(213, 'App\\Models\\Admodels\\PostModel', 7, 'string', 'large_description', '<p>We made an intentional and assertive push to reach Emirati Youth across all 7 Emirates and around the world.&nbsp;So we went first where Youth is live online.</p><p>We posted invitations for their ideas via Instagram, Twitter, Snapchat, and Facebook. We sent emails through university listserves.</p>'),
(214, 'App\\Models\\Admodels\\PostModel', 7, 'string', 'large_description_arabic', '<p>اطلعنا على أفضل الممارسات العالمية، وعلى ما توفره المراكز، والمساحات المشتركة، والمسرعّات، والحاضنات حول العالم ونفخر بأن مركز الشباب هو الأفضل.</p><p>الهدف أن نطوّر هذا المركز كنموذج عالمي لمراكز الشباب وبناء مراكز شباب مماثلة في إمارات الدولة وفي العالم العربي لتكون حاضنة لإبداعات الشباب ومراكز لبناء القيادات الشابة</p>'),
(221, 'App\\Models\\Admodels\\PostModel', 12, 'string', 'short_description', '<p>X marks a spot, multiplies numbers, and defines a generation. X represents the Roman numeral 10 and also wins 10 points on the Scrabble board. It is one of the least-utilized letters in the alphabet, the most utilized letter in science and mathematics, and the rays across the greater electromagnetic spectrum that allow us to see inside the body without making an incision.</p>'),
(222, 'App\\Models\\Admodels\\PostModel', 12, 'string', 'short_description_arabic', '<p>يرمز عادة إلى المتغير باستخدام الرمز X ويرجع استخدام هذا الحرف إلى الكلمة العربية (شيء) التي ذكرت في كتب علم الجبر عند علماء الرياضيات العرب، وعند ترجمة هذه الكتب إلى اللغة الإسبانية القديمة كتبت على شكل الكلمة xei (لفظها &ldquo;&scaron;ei&rdquo;) ولاحقاً تم أخذ الحرف الأول من هذه الكلمة للتعبير عن المتحول</p>'),
(223, 'App\\Models\\Admodels\\PostModel', 12, 'string', 'large_description', 'X marks a spot, multiplies numbers, and defines a generation. X represents the Roman numeral 10 and also wins 10 points on the Scrabble board. It is one of the least-utilized letters in the alphabet, the most utilized letter in science and mathematics, and the rays across the greater electromagnetic spectrum that allow us to see inside the body without making an incision.&nbsp;<strong>X is polymathic.&nbsp;X is versatile.</strong><br /><br />If you took Algebra in school, you were introduced to X - the most commonly used universal variable that represents the essential factor to solving a problem. X + 10 = Y.&nbsp;<strong>X is the mystery ingredient.&nbsp;X points us to a solution.</strong><br /><br />X originates back to the Arabic word &ldquo;شيئاً&rdquo; which means \"the unknown thing\". Our Arabian founding fathers set in motion one of the most dynamic characters shared among languages.&nbsp;<strong>X is legacy.&nbsp;X is potential.</strong>'),
(224, 'App\\Models\\Admodels\\PostModel', 12, 'string', 'large_description_arabic', 'يرمز عادة إلى المتغير باستخدام الرمز X ويرجع استخدام هذا الحرف إلى الكلمة العربية (شيء) التي ذكرت في كتب علم الجبر عند علماء الرياضيات العرب، وعند ترجمة هذه الكتب إلى اللغة الإسبانية القديمة كتبت على شكل الكلمة xei (لفظها &ldquo;&scaron;ei&rdquo;) ولاحقاً تم أخذ الحرف الأول من هذه الكلمة للتعبير عن المتحول. X ترمز إلى الاكتشاف، إلى الإبداع، إلى المتغيّر، إلى الفضول... X يذكرنا بريادة العرب، ويذكرنا بروح الشباب. البحث عن الحلول والتغيير للأفضل دوماً هو X'),
(225, 'App\\Models\\Admodels\\PostModel', 12, 'string', 'video_url', 'https://www.youtube.com/watch?v=61pm1Dr92pE'),
(226, 'App\\Models\\Admodels\\PostModel', 12, 'string', 'main_image', '3858c61f9fb3e30682e734786aaa7112.jpeg'),
(287, 'App\\Models\\Admodels\\PostModel', 13, 'string', 'short_description', '<p>We claim this ground as our \"home\" where we can develop our best selves for today and our best innovations for tomorrow.</p>'),
(288, 'App\\Models\\Admodels\\PostModel', 13, 'string', 'short_description_arabic', '<p>نحن في مركز الشباب ننظر لهذا المكان بصفته \"المنزل\" حيث باستطاعتنا، اليوم، تطوير أنفسنا للأفضل، والعمل للتوصل لأفضل ابتكاراتنا في سبيل المستقبل.</p>'),
(289, 'App\\Models\\Admodels\\PostModel', 13, 'string', 'large_description', 'We claim this ground as our \"home\" where we can develop our best selves for today and our best innovations for tomorrow.<br /><br />So come, learn in our Academy, read in our Library, pitch in our Lounge, collaborate and create in our co-working space. Then tell us about your experience in a Youth Circle or online. Tell us what&rsquo;s working for you and how we can make it better. Tell us YOUR IDEAS for how Youth can lead the UAE and our world successfully into the 21st century.<br /><br />Come be part of the new network of YOUNG creatives, innovators and entrepreneurs. Together, we will create the future.<br /><br />Check out all you can experience at the Youth xHub'),
(290, 'App\\Models\\Admodels\\PostModel', 13, 'string', 'large_description_arabic', 'نحن في مركز الشباب ننظر لهذا المكان بصفته \"المنزل\" حيث باستطاعتنا، اليوم، تطوير أنفسنا للأفضل، والعمل للتوصل لأفضل ابتكاراتنا في سبيل المستقبل.<br /><br />ها نحن نوجه دعوتنا لكل شاب ليتعلم في فصولنا، ويقرأ في مكتبتنا، ويلعب في جناحنا، ويتعاون ويبدع في فضاء عملنا الجماعي. ليخبرنا لاحقاً عن تجربته في إحدى الحلقات الشبابية أو عبر الإنترنت. إننا نطلب منكم زيادة معرفتنا بالأمور التي تناسبكم، والسبل التي يمكن لمركز الشباب المساهمة بها لتحسينها. أخبرونا عن أفكاركم حول الكيفية التي تعزز وتمكن الشباب من قيادة الدولة والعالم بنجاح خلال القرن الحادي والعشرين.<br /><br />تفضلوا لتكونوا جزءا من الشبكة الجديدة لتواصل الشباب المبدعين والمبتكرين ورواد الأعمال، لأننا سنسهم سوياً في صناعة المستقبل.<br /><br />اطلعوا على كل ما يمكنكم تجربته في مركز الشباب<br />بوليفارد أبراج الإمارات، دبي، الإمارات العربية المتحدة<br />رابط خرائط غوغل'),
(291, 'App\\Models\\Admodels\\PostModel', 13, 'string', 'address', '<p>Check out all you can experience at the Youth xHub</p><address><p>Emirates Towers Boulevard, Dubai,</p><p>United Arab Emirates,</p><p>Working Hours: 8 AM -10 PM (All Week)Two (2) hours free parking at the Boulevard, underground parking.</p></address>'),
(292, 'App\\Models\\Admodels\\PostModel', 13, 'string', 'address_arabic', '<p>اطلعوا على كل ما يمكنكم تجربته في مركز الشباب</p><address><p>بوليفارد أبراج الإمارات، دبي، الإمارات العربية المتحدة ساعات العمل 8:00 ص &ndash; 10:00 م (جميع أيام الأسبوع)ساعتين (2) مجانية لمواقف السيارات في البوليفارد، الدور الأرضي.</p></address>'),
(293, 'App\\Models\\Admodels\\PostModel', 13, 'string', 'map_embedd_code', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7219.161107527832!2d55.28264!3d25.217364!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x1d31072c85d65168!2sYouth+x+Hub!5e0!3m2!1sen!2sae!4v1560342117682!5m2!1sen!2sae\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>');
