(3659, 'en', '*', 'messages.php-17-1-18', 'nominate_yourself_text', '\"You have made it. You have created positive change in yourself and your surrounding environment. Now is the time to get the recognition you deserve. The only requirements are for you to be from the Arab world and between the ages of 15 to 30 years old. Please enter your information below. The submission will end on Thursday the 5th of October, 2017.\"', 0, 0, '2019-06-18 03:04:04', '2019-06-18 03:04:04'),
