(3663, 'en', '*', 'messages.php-17-1-18', 'nominate_a_pioneer_text', '\"You can nominate a pioneer that you believe in, admire, respect their achievements and the change they created in their surroundings. The only conditions are for them to be from the Arab World, and between the ages of 15 to 30 years old. The submission will end on Thursday the 5th of October, 2017.\"', 0, 0, '2019-06-18 03:04:04', '2019-06-18 03:04:04'),
